import React from 'react';
import { useParams } from 'react-router-dom';

import Tw_notes_song from './tw_notes_song.jsx';
import Ways_to_go_song from './ways_to_go_song.jsx';
import In_a_little_song from './in_a_little_song.jsx';
import Different_kind_of_beautiful_song from './different_kind_of_beautiful_song.jsx';
import Pick_me_song from './pick_me_song.jsx';
import Sacrifice_tomorrow_song from './sacrifice_tomorrow_song.jsx';
import I_sent_my_therapist_to_therapy_song from './i_sent_my_therapist_to_therapy_song.jsx';
import The_arsonist_song from './the_arsonist_song.jsx';
import Lead_me_to_water_song from './lead_me_to_water_song.jsx';
import By_now_song from './by_now_song.jsx';
import King_size_bed_song from './king_size_bed_song.jsx';
import Love_the_ones_who_leave_song from './love_the_ones_who_leave_song.jsx';

import Mind_is_a_prison_song from './mind_is_a_prison_song.jsx';
import Demons_song from './demons_song.jsx';
import Oh_my_god_song from './oh_my_god_song.jsx';
import The_book_of_you_and_i_song from './the_book_of_you_&_i_song.jsx';
import Match_in_the_rain_song from './match_in_the_rain_song.jsx';
import Jesus_in_la_song from './jesus_in_la_song.jsx';
import I_am_not_a_cynic_song from './im_not_a_cynic_song.jsx';
import Alamo_song from './alamo_song.jsx';
import Must_have_been_the_wind_song from './must_have_been_the_wind_song.jsx';
import Just_like_you_song from './just_like_you_song.jsx';

function SongPage() {
    const { id } = useParams(); // Получаем id из URL

    // Определяем, какой компонент песни отобразить
    let SongComponent;

    switch (id) {
        case 'tw_notes':
            SongComponent = Tw_notes_song;
            break;
        case 'ways_to_go':
            SongComponent = Ways_to_go_song;
            break;
        case 'in_a_little':
            SongComponent = In_a_little_song;
            break;
        case 'different_kind_of_beautiful':
            SongComponent = Different_kind_of_beautiful_song;
            break;
        case 'pick_me':
            SongComponent = Pick_me_song;
            break;
        case 'sacrifice_tomorrow':
            SongComponent = Sacrifice_tomorrow_song;
            break;
        case 'i_sent_my_therapist_to_therapy':
            SongComponent = I_sent_my_therapist_to_therapy_song;
            break;
        case 'the_arsonist':
            SongComponent = The_arsonist_song;
            break;
        case 'lead_me_to_water':
            SongComponent = Lead_me_to_water_song;
            break;
        case 'by_now':
            SongComponent = By_now_song;
            break;
        case 'king_size_bed':
            SongComponent = King_size_bed_song;
            break;
        case 'love_the_ones_who_leave':
            SongComponent = Love_the_ones_who_leave_song;
            break;
        case 'mind_is_a_prison':
            SongComponent = Mind_is_a_prison_song;
            break;
        case 'demons':
            SongComponent = Demons_song;
            break;
        case 'oh_my_god':
            SongComponent = Oh_my_god_song;
            break;
        case 'the_book_of_you_and_i':
            SongComponent = The_book_of_you_and_i_song;
            break;
        case 'match_in_the_rain':
            SongComponent = Match_in_the_rain_song;
            break;
        case 'jesus_in_la':
            SongComponent = Jesus_in_la_song;
            break;
        case 'i_am_not_a_cynic':
            SongComponent = I_am_not_a_cynic_song;
            break;
        case 'alamo':
            SongComponent = Alamo_song;
            break;
        case 'must_have_been_the_wind':
            SongComponent = Must_have_been_the_wind_song;
            break;
        case 'just_like_you':
            SongComponent = Just_like_you_song;
            break;
        default:
            SongComponent = () => <div>Song not found</div>;
    }

    return (
        <div>
            <SongComponent /> {/* Рендерим выбранный компонент */}
        </div>
    );
}

export default SongPage;
